INSERT INTO "wagtailcore_pagerevision" VALUES(4,0,'{"pk": 5, "path": "000100010002", "depth": 3, "numchild": 0, "title": "The hunger game", "draft_title": "The hunger game", "slug": "hunger-game", "content_type": 7, "live": false, "has_unpublished_changes": false, "url_path": "/home/hunger-game/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "date": "2019-10-06", "header": "", "type": "law", "summary": "Eating is for survival. Not to satisfy social norms.", "body": "<p>We have been conditioned to eat three times a day. Parents are effectively force feeding their children while effectively, their growth is coded in their DNA therefore the diet, while instrumental, is not the driver of their physical development.<br/>There is no need to eat, work and repeat without assessing what we eat for and what we sleep for.</p>", "link": "", "reference": "", "notes": "", "tagged_items": [{"pk": 1, "tag": 1, "content_object": 5}, {"pk": 2, "tag": 2, "content_object": 5}, {"pk": 3, "tag": 3, "content_object": 5}]}',NULL,5,1,'2019-10-06 23:21:03.483783');
